import React, { useEffect, useState } from "react";
import { useAircrafts, useFlights } from "../../hooks";
import { Page } from '../../components';
import Grid from "@mui/material/Grid";
import ArrowBackIosIcon from "@mui/icons-material/ArrowBackIos";
import ArrowForwardIosIcon from "@mui/icons-material/ArrowForwardIos";
import "./MainPage.css";
import { Flights } from "./Flights";
import { Rotation } from "./Rotation";
import { Aircrafts } from "./Aircrafts";

const MainPage: React.FC = () => {
  const { flights, isLoadingFlights } = useFlights({
    offset: 0,
    limit: 7,
  });
  const { aircrafts, isLoadingAircrafts } = useAircrafts({
    offset: 0,
    limit: 25,
  });

  if (isLoadingFlights || isLoadingAircrafts) return <></>;

  console.log("aircrafts ->", aircrafts);

    return (
      <Page>
        <Grid sx={{ flexGrow: 1 }} container spacing={2}>
          <Grid item xs={12}>
            <Grid container justifyContent="center" spacing={2}>
              <Grid key={"header"} item>
                <div style={{ display: "flex" }}>
                  <ArrowBackIosIcon />
                  <div style={{ paddingTop: "3px", paddingRight: "5px" }}>
                    {"4th January 2018"}
                  </div>
                  <ArrowForwardIosIcon />
                </div>
                <div>{"Rotation ABCDE"}</div>
              </Grid>
            </Grid>
          </Grid>
        </Grid>
        <Grid sx={{ flexGrow: 1 }} container spacing={2}>
          <Grid item xs={12}>
            <Grid container justifyContent="center" spacing={2}>
              <Grid key={"aircrafts-list"} item>
                  <Aircrafts aircrafts={aircrafts}/>
              </Grid>
              <Grid key={"rotation-list"} item>
                <Rotation />
              </Grid>
              <Grid key={"flights-list"} item>
                <Flights flights={flights} />
              </Grid>
            </Grid>
          </Grid>
        </Grid>
      </Page>
    );
};

export default MainPage;
